	/**
	 * 汉字的笔画顺序
	 * 
	 * @param chinese
	 * @return
	 */
	public static String bihua(char chinese) {
		String bihuaIndex = bihuaMap.get(Integer.valueOf((int) chinese));
		if (null == bihuaIndex) {
			return null;
		}
		StringBuffer bihua = new StringBuffer();
		int c = '9' - 9;
		for (int i = 0; i < bihuaIndex.length(); i++) {
			int index = bihuaIndex.charAt(i) - c;
			bihua.append(Bihua.index(index).t9);
		}
		return new String(bihua);
	}

